import React from "react";
import styled from "styled-components";
import cover from "../../Assets/selfparking.jpg"


function HeadMain() {
    return (
        <HeadContainer>
            <CoverImg
                src={cover}
                alt='logo' 
            />
        </HeadContainer>

    );
}

const HeadContainer = styled.section`
    display: flex;

`
const CoverImg= styled.img`
    height: 160px;
    width: 160px;

`

export default HeadMain
